    new Todo("Learn React"),
    new Todo("Learn Typescript"),
  ]);
  const addTodoHandler = (text: string) => {};

  return (
    <div className="App">
      <NewTodo onAddTodo={addTodoHandler} />
      <Todos items={todos} />
